import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 32, height: 32, viewBox: "0 0 32 32", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M27.31 10.34a4 4 0 00-5.65-5.65l-1.4 1.4 5.65 5.66 1.4-1.4z", fill: primaryFill }),
        React.createElement("path", { d: "M24.5 13.16L12.54 25.12a5 5 0 01-2.32 1.31l-4.58 1.15a1 1 0 01-1.22-1.22l1.15-4.58a5 5 0 011.31-2.32L18.84 7.5l5.66 5.66z", fill: primaryFill }));
};
const Edit32Filled = wrapIcon(rawSvg({}), 'Edit32Filled');
export default Edit32Filled;
